import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      result.forEach(item => setData(data.push(item)))
    })
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
